import React, { Component } from 'react';
import headerLogo from './logo.jpg';
import './style.css';
import { Menu, Icon } from 'antd';


export default class AppHeader extends Component {
    constructor(props) {
        super(props);
        this.state = {
            list: [{
                id : 1,
                icon: 'mail',
                title: 'VOA English',
            },
            {
                id : 2,
                icon: 'mail',
                title: 'VOA English',
            },
            {
                id : 3,
                icon: 'mail',
                title: 'VOA English',
            },
            {
                id : 4,
                icon: 'mail',
                title: 'VOA English',
            },
            {
                id : 5,
                icon: 'mail',
                title: 'VOA English',
            },
            {
                id : 6,
                icon: 'mail',
                title: 'VOA English',
            },
        ],
        }
    };
    render() {
        return (
            <div>
                <img src={headerLogo} className="app-header-logo" />
                {/* horizontal代表横向展示 */}
                <Menu 
                mode="horizontal"
                className="app-header-menu"
                >
                    <Menu.Item key="mail1">
                        <Icon type="mail" />
                        VOA  English
                    </Menu.Item>
                    <Menu.Item key="mail2">
                        <Icon type="mail" />
                        VOA  English
                    </Menu.Item>
                    <Menu.Item key="mail3">
                        <Icon type="mail" />
                        VOA  English
                    </Menu.Item>
                    <Menu.Item key="mail4">
                        <Icon type="mail" />
                        VOA  English
                    </Menu.Item>
                    <Menu.Item key="mail5">
                        <Icon type="mail" />
                        VOA  English
                    </Menu.Item>
                    <Menu.Item key="mail6">
                        <Icon type="mail" />
                        VOA  English
                    </Menu.Item>
                </Menu>
            </div>
                );
            };
        }
